&quot;Panacea is an American hip hop duo, formed in 2003 in Washington DC. The duo consists of MC Raw Poetic (Jason Moore) and producer K-Murdock (Kyle Murdock),[1]. Throughout their musical career, Panacea has had deals with various labels, including: Glow-in-the-Dark-Records, Rawkus Records [2] and Tasteful Licks. They currently release their music under K-Murdock's imprint, Neosonic Productions.

Combining old-school rhyming with soulful beats, the Washington D.C. duo Panacea have drawn comparisons to revered hip-hoppers like the Roots, Gang Starr, and A Tribe Called Quest. Panacea blend Native Tongues-inspired beats with warm major chords and soul samples and add smart, conscious rhymes about life, love, and of course, hip hop.&quot;


